import { delDomain } from '@/api/table'

export default {
  data() {
    return {
      form: {
        domain: ''
      }
    }
  },
  methods: {
    onSubmit() {
      this.$refs.dataForm.validate((valid) => {
        if (valid) {
          delDomain(this.form).then(() => {
            this.dialogFormVisible = false
            this.$message({
              message: '删除成功',
              type: 'warning'
            })
          })
        }
      })
    },
    onCancel() {
      this.$message({
        message: 'cancel!',
        type: 'warning'
      })
    }
  }
}
